import React from 'react'


export default function Question(props) {
  return (
   <>
    
    <h1>{ props.qno} {props.quest}</h1>


        <input type='radio' name='options' value='A' /> {props.optA}
        <br></br>
        <input type='radio' name='options' value='B' /> {props.optB}
        <br></br>
        <input type='radio' name='options' value='C' /> {props.optC}
        
        <br></br>
        <input type='radio' name='options' value='D' /> {props.optD}
        <br></br> <br></br>
        <button type='submit'>Submit Question</button>

        
   </>
  )
}
